const AdmZip = require('adm-zip');

function extractDocxText(path) {
  const zip = new AdmZip(path);
  const xml = zip.readAsText('word/document.xml');
  // Simple regex extraction of text from XML
  const texts = [];
  const paragraphs = xml.split(/<\/w:p>/g);
  for (const p of paragraphs) {
    const runs = [...p.matchAll(/<w:t[^>]*>([^<]*)<\/w:t>/g)];
    const line = runs.map(m => m[1]).join('');
    if (line.trim()) texts.push(line.trim());
  }
  return texts.join('\n');
}

